import React, { useState } from 'react';
import { useSelector } from 'react-redux';
import './Part.css';

function dispatchClick(setPlayed) {
  setPlayed(true);
}


function Part({ position }) {
  const [played, setPlayed] = useState(false);
  const plays = useSelector(state => state);
  console.log(plays);
  return (
    <div
      onClick={() => dispatchClick(setPlayed)}
      className={played ? `play${findCurrentPlay()}` : 'notPlayed'}
    ></div>
  );
}

